  ];

  const [fullName, setFullName] = useState("");
  const [Mail, setMail] = useState("");

  return (<>
   <div className="component-container">
      {/* תוכן הקומפוננטה */}
      {/* #c98a45 */}
    <Box sx={{ backgroundcolor:'#c98a45', display: 'flex' }}>
      <CssBaseline />
      <AppBar component="nav">
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
          <Typography
            variant="h6"
            component="div"
            sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
          >
             <img src={"/13234.png"} style={{ height: "100px", borderRadius: "100px" }} />
          </Typography>
          <Box sx={{ display: { xs: 'none', sm: 'block' } }}>

      <Button variant="outlined" sx={{padding:"20px", margin:"50px",border: "2px solid white" ,color:"white"}} onClick={handleClickOpen3}>
        אישור כניסת משתמשים
      </Button>
      <Button variant="outlined" sx={{padding:"20px",margin:"50px",border: "2px solid white",color:"white"}} onClick={handleClickOpen2}>
חדר בקרה בזמן אצת      </Button>
      <Button sx={{padding:"20px", margin:"50px",border: "2px solid white",color:"white"}}  onClick={handleClickOpen1}>        שליחת קריאה
           </Button>
          </Box>
        </Toolbar>
      </AppBar>
      {/* <Box component="nav">
        <Drawer
          container={container}
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{
            keepMounted: true, // Better open performance on mobile.
          }}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
          }}
        >
          {drawer}
        </Drawer>
      </Box>
      */}
    </Box> 




    <Dialog open={open1} onClose={handleClose1}>
        <DialogTitle>:פרטי שליחת הקריאה</DialogTitle>
        <DialogContent>
        <TextField
          sx={{
            marginTop: 3,
            borderRadius: "30px",
          }}

          id="FullName-basic"
          label="נקודת ציון"
          variant="outlined"
          onChange={(e) => {setFullName(e.target.value) }}
        />
        <br/>
        <TextField
          sx={{
            marginTop: 3,
            borderRadius: "15px",
          }}
          id="Mail-basic"
          label="רדיוס"
          variant="outlined"
          onChange={(e) => {setMail(e.target.value)}}
        />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose1}>שליחה</Button>
        </DialogActions>
      </Dialog>

      <Dialog
        fullScreen
        open={open2}
        onClose={handleClose2}

      >
        <AppBar sx={{ position: 'relative' }}>
          <Toolbar>
            <IconButton
              edge="start"
              color="inherit"
              onClick={handleClose2}
              aria-label="close"
            >
              <CloseIcon />
            </IconButton>
            <Typography sx={{ ml: 2, flex: 1 }} variant="h6" component="div">
              חדר בקרה
            </Typography>

          </Toolbar>
        </AppBar>

                <Card
                  sx={{
                    margin: 1,
                    borderRadius: 3,
                    scale: 4,
                    //put this shit in here <3
                  }}
                >
                  <ImageButton
                    focusRipple
                    //אני רוצה שהוא ישלח את הקאי לקומפוננטה של בקורס לכיתה איך עושים את זה??

                  >
                    <img src={"/class.jpg"} />
                    {/* <ImageSrc style={{ backgroundImage: `url(${image.url})` }} />*/}

                    <Image>
                      <Typography
                        component="span"
                        variant="h4"
                        color="inherit"
                        sx={{
                          position: "relative",
                          p: 2,
                          pt: 2,
                          pb: (theme) => `calc(${theme.spacing(1)} + 6px)`,
                        }}
                      >
                        Class-
                        <ImageMarked className="MuiImageMarked-root" />
                      </Typography>
                    </Image>
                  </ImageButton>
                  <div>
                    <Button
                      sx={{ width: "50%" }}
                      color="inherit"
                      onClick={() => handleClickOpen(image)}
                    >
                      <EditIcon />
                    </Button>
                    <Button
                      sx={{ width: "50%" }}
                      color="inherit"
                      onClick={() => {
                        handleClickDelete(image);
                      }}
                    >
                      <DeleteIcon />
                    </Button>
                    <Dialog open={open} onClose={handleClose}>
                      <DialogTitle>Class update</DialogTitle>
                      <DialogContent>
                        <UpdetGroup
                          dialoghandleClose={handleClose}
                          updateGrp={updateGrp}
                          setList={setData}
                          listGroup={data}
                        />
                      </DialogContent>
                    </Dialog>
                  </div>
                </Card>
              ))}
      </Dialog>

      <Dialog
        fullScreen
        open={open3}
        onClose={handleClose3}

      >
        <AppBar sx={{ position: 'relative' }}>
          <Toolbar>
            <IconButton
              edge="start"
              color="inherit"
              onClick={handleClose3}
              aria-label="close"
            >
              <CloseIcon />
            </IconButton>
            <Typography sx={{ ml: 2, flex: 1 }} variant="h6" component="div">
              Sound
            </Typography>
            <Button autoFocus color="inherit" onClick={handleClose3}>
              save
            </Button>
          </Toolbar>
        </AppBar>
        <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
          <TableCell> לאשר</TableCell>
          <TableCell>לא לאשר</TableCell>
            <TableCell>מספר פלאפון</TableCell>
            <TableCell align="right">מייל</TableCell>
            <TableCell align="right">פלאפון</TableCell>
            <TableCell align="right">משפחה</TableCell>
            <TableCell align="right">שם</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
               <TableCell> <Button variant="outlined"  onClick={handleClickOpen3}>
        אשר
        </Button></TableCell>
        <TableCell> <Button variant="outlined"  onClick={handleClickOpen3}>
        מחק
      </Button></TableCell>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.name}</TableCell>
              <TableCell align="right">{row.family}</TableCell>
              <TableCell align="right">{row.adress}</TableCell>
              <TableCell align="right">{row.poghn}</TableCell>
              <TableCell align="right">{row.drone}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
      </Dialog> </div>
    </>

  );
}

